export default {
  mainContainer: {
    flex: 1,
    backgroundColor: 'transparent',
    alignItems: 'center',
    position: 'absolute',
    top: 0,
    bottom: 0,
    right: 0,
    left: 0
  },
  coloredView: {
    height: 200,
    width: 200,
    backgroundColor: '#029DAD',
    alignItems: 'center'
  }
}
